    and OpenAI that enables business analysts, product owners, QA leads, and DDD designers
    to collaboratively create, manage, and evolve hierarchical business documentation
    through conversational AI interfaces. The system will guide users through structured
    workflows with context-aware prompts, maintain document relationships, propagate
    changes through ripple effects, and support RAG-enabled context retrieval from
    PostgreSQL vector storage.'
